        title:"Frist item",
        desc: "lorem is free decs",
        complet: false
      },
      {
        id : 2 , 
        title:"two item",
        desc: "lorem is free decs",
        complet: true
      },
      {
        id : 3 , 
        title:"three item",
        desc: "lorem is free decs",
        complet: false
      },
    ]
  }
  makechange = ()=>{
    console.log("hello from appsjs")
  }
  render(){
    return(
      <div className="App">
      <header className="App-header">
       <Todos todos={this.state.Todo} makechange={this.makechange} />
      </header>
     </div>

    );
  }
}

export default App;
